INSERT INTO `certificate_templates` VALUES ('1','payment_completion','완납증명서','완납증명서<h3 style=\"text-align:center; font-size:24px;\">완 납 증 명 서</h3><br><br><p><br></p><table class=\"table table-bordered\"><tbody><tr><td>항목</td><td>내용</td><td>비고</td></tr><tr><td><b>계약번호</b></td><td>[계약번호]</td><td><br></td></tr><tr><td><b>채무자명</b></td><td>[고객명]</td><td><br></td></tr><tr><td><b>대출원금</b></td><td>[대출원금]</td><td><br></td></tr><tr><td><b>대출일자</b></td><td>[대출일]</td><td><br></td></tr><tr><td><b>완납일자</b></td><td>[완납일자]</td><td><br></td></tr></tbody></table><p><br></p><p><br></p><br><h3>위 채무자는 당사와의 대출 계약에 대하여 [완납일자] 현재 모든 채무(원금, 이자 등)를 완납하였음을 증명합니다.</h3><br><br><br><p style=\"text-align:center;\">[오늘날짜]</p><br><br><div style=\"text-align:center;\"><p style=\"font-size:18px; font-weight:bold;\">[회사명]</p><p><strong>대표이사: [회사대표]&nbsp; [법인인감]</strong></p><p>주소: [회사주소]</p><p>연락처: [회사연락처]</p></div>\r\n','2025-11-25 12:05:41','2025-11-25 12:05:41');
INSERT INTO `certificate_templates` VALUES ('2','auction_notice','경매예정통보','경매예정통보<h1 style=\"text-align:center; font-size:24px;\">기한의 이익 상실 및 경매예정 통보</h1><br><p><strong>발신 : [회사명]</strong></p><p><strong>주소 : [회사주소]</strong></p><p><strong>수신:</strong> [고객명] 귀하</p><p><strong>주소:</strong> [고객주소]</p><br><p>&nbsp;- 당사는 \"대부업 등의 등록 및 금융이용자 보호에 관한 법률\"에 근거하여 정식으로 등록되어 \r\n대부업을 영위하는 회사입니다</p><p>&nbsp;-&nbsp;본 문건은 귀하의 채무불이행 사실과 기한의 이익이 상실됨을 알리고 그에 따른 법적 조치를 \r\n통보하기 위하여 작성되었습니다.</p><p>&nbsp;-&nbsp;귀하는 [대출일] 에 금 [대출원금]원을 대출받으며 그 만기를 [만기일] 로 하고 매월 [약정일]일에 연 [정상금리]%의 정상이자와 연 [연체금리]% 의 연체이자와 함께 원금을 상환하기로 확약하여 당사와 \r\n대부거래계약을 체결하였습니다.</p><p>&nbsp;-&nbsp;그러나 귀하는 [최근거래일] 이후 변제에 대한 어떠한 노력도 하지 않고 있고 당사의 \r\n수회에 걸친 변제요구에 응답도 하지 않고 있습니다.</p><p>귀하께서는 당사와의 여신거래약정(계약번호: [계약번호])에 따라 발생한 채무에 대하여 수차례의 변제 독촉에도 불구하고 현재까지 채무를 이행하지 않고 있습니다.</p><p>이에 당사는 귀하의 채무 불이행에 따라 담보로 제공된 아래 부동산에 대하여 법원에 임의경매를 신청할 예정임을 통보합니다.</p><p style=\"text-align: center; \"><strong>- 아 래 -</strong></p><p><strong>1. 담보 부동산:</strong>&nbsp;[고객주소]</p><p><strong>2. 채무내역:</strong> 원금 [대출잔액] 및 연체이자</p><p><strong>3. 변제기한:</strong> [오늘날짜]로부터 7일 이내</p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td>계약일</td><td>고객명</td><td>금리</td><td>대출금액</td><td>대출잔액</td><td>이자</td><td>합계</td></tr><tr><td>[대출일]</td><td>[고객명]</td><td>[정상금리]</td><td>[대출원금]</td><td>[대출잔액]</td><td>일자별상이(문의)</td><td>일자별상이(문의)</td></tr></tbody></table><p><br></p><p>만약 위 변제기한까지 채무 전액을 변제하지 않을 경우, 예고 없이 경매 절차를 진행할 것이며 이로 인해 발생하는 모든 법적 비용 및 책임은 귀하에게 있음을 알려드립니다.</p><p style=\"text-align:center;\">[오늘날짜]</p><font color=\"#ff0000\">※채권추심업무 처리절차와 채무자의 불법채권추심 대응요령은 당사홈페이지 또는 대부금융협회 , 금융감독원 홈페이지를 통해 공시된 내용을 확인할 수 있으며 내용에 대하여 당사 [회사연락처] 담당자: [담당자명] 로 전화문의 가능합니다</font><br><div style=\"text-align:center;\"><p style=\"font-size:18px; font-weight:bold;\">[회사명]</p><p><strong>대표이사: [회사대표] [법인인감]</strong></p></div>','2025-11-25 12:05:41','2025-11-25 12:05:41');
INSERT INTO `certificate_templates` VALUES ('3','benefit_loss_notice','기한의 이익상실 통지서','<h1 style=\"text-align:center; font-size:24px;\"><u>기한의 이익 상실(EOD) 통지서</u></h1><p><strong><br></strong></p><p><strong>발신: [회사명]</strong></p><p><strong>주소: [회사주소]</strong></p><p><strong>수신:</strong> [고객명] 귀하</p><p><strong>주소:</strong> [고객주소]</p><p>- 귀하의 안녕과 평안을 기원합니다.</p><p>- 당사는 \"대부업 등의 등록 및 금융이용자 보호에 관한 법률\"에 근거하여 정식으로 등록되어 \r\n대부업을 영위하는 회사입니다.</p><p>-&nbsp;본 문건은 귀하의 채무불이행 사실과 기한의 이익이 상실됨을 알리고 그에 따른 법적 조치를 \r\n통보하기 위하여 작성되었습니다.</p><p>-&nbsp;귀하는 [대출일] 에 금 [대출원금]을 대부받으며 그 만기를&nbsp; [만기일]&nbsp;로 하고 매월 [약정일] 에 연 [정상금리]의 정상이자와 연 [연체금리] 의 연체이자와 함께 원금을 상환하기로 확약하여 당사와 \r\n대부거래계약을 체결하였습니다.</p><p>-&nbsp;그러나 귀하는&nbsp; [최근거래일] 이후 변제에 대한 어떠한 노력도 하지 않고 있고 당사의 \r\n수회에 걸친 변제요구에 응답도 하지 않고 있습니다.</p><p>-&nbsp;상기 내용을 종합해보면 귀하는 정상적으로 채무를 이행할 의사가 없는 것으로 보이며 \"대부 \r\n거래표준약관\" 제 12조에 근거하여 기한의 이익이 상실된 바, 아래 표시한 잔존채무금 전체를 상환하여 주시길 바라오며 이렇게 간곡한 요구에도 \r\n아무런 답이 없다면 민,형사상의 법조치를 진행할 예정이오니 참고하시길 바랍니다</p><p>-&nbsp;당사는 진심으로 귀하의 신용회복을기원하고 있으며 본 문건에 사실과 다른 내용이 있다면 수령 \r\n후 7영업일 이내에 답변 부탁드립니다.</p><p>-&nbsp;본 문건은 당사의 권리보호를 위해 내용증명으로 발송되었습니다.</p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td style=\"text-align: center; \">계약번호</td><td style=\"text-align: center; \">대출원금</td><td style=\"text-align: center; \">대출잔액</td><td style=\"text-align: center; \">대출이자</td><td style=\"text-align: center; \">잔존채무전체</td></tr><tr><td>[계약번호]</td><td>[대출원금]</td><td>[대출잔액]</td><td>일정별상이(문의)</td><td>일정별상이(문의)</td></tr></tbody></table><p><br></p><p>따라서 귀하는 본 통지서 도달 즉시 대출 원리금 전액을 변제하여야 하며, 만약 변제가 이루어지지 않을 경우 당사는 해당채권에 대하여 법적 조치를 취할 수 있음을 알려드립니다.</p><p style=\"text-align:center;\"><b>[오늘날짜]</b></p><p style=\"text-align: right;\"><font color=\"#ff0000\" style=\"font-size: small;\">※채권추심업무 처리절차와 채무자의 불법채권추심 대응요령은 당사홈페이지(</font><font color=\"#0000ff\" style=\"font-size: small;\"><a href=\"http://hpplus.co.kr/\">https://</a>pdloan.co.kr</font><font color=\"#ff0000\" style=\"font-size: small;\">)</font></p><font size=\"2\"><div style=\"text-align: right;\"><span style=\"color: rgb(255, 0, 0);\">하단에 공시되어 있으며 공시내용에 대하여 \r\n당사([회사연락처] 담당자:[담당자명])로 전화문의도 가능합니다.</span></div></font><div style=\"text-align:center;\"><p style=\"font-size:18px; font-weight:bold;\">[회사명]&nbsp; &nbsp;<strong style=\"font-size: 14px;\">대표이사: [회사대표] [법인인감]</strong></p></div>','2025-11-25 12:05:41','2025-11-25 12:05:41');
INSERT INTO `certificate_templates` VALUES ('4','dunning_letter','독촉장','<h1 style=\"text-align: center; \"><b>독&nbsp; &nbsp; 촉&nbsp; &nbsp; 장</b></h1>\r\n<p>발송일 : [오늘날짜]</p>\r\n<p>\r\n<br>\r\n</p>\r\n<table class=\"table table-bordered\" style=\"width: 800px;\" \"align=\"center&quot;\"><tbody><tr><td>성명</td><td>[고객명]</td><td>계약번호</td><td>[계약번호]</td></tr></tbody></table><p><br></p><p>고객님의 대출원리금이 현재 입금 확인이 되고 있지 않은 상태로 <b>[현재연체일수]째 연체</b>되고 있습니다. <br>이대로 방치하시면 연체되고 있는 지불금액 의 \r\n입금뿐만이 아니라, 계약조항에 따라<br>기한이익상실이 되는경우 전액을 일괄 청구하게 되어 고객님의 신용 및 재산상의 불이익을 초래하게 됩니다. \r\n<br>&nbsp;또한, 부득이하게 당사의 채권 관리부에서 고객님의 자택, 회사등을 방문하여 청구하는 경우가 발생하지 않도록<br>(<span style=\"background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span>)<b>까지 당사로 입금하시고 반드시 \r\n연락</b> 주시길 부탁드립니다.&nbsp;</p><p><br></p><p style=\"text-align: right; \">청구일자 기준일 (<span style=\"background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>)</p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td>대출날짜 :&nbsp;</td><td>[대출일]</td></tr><tr><td>대출금액 :&nbsp;</td><td>[대출원금]</td></tr><tr><td>대출잔액 :&nbsp;</td><td>[대출잔액]</td></tr><tr><td>청구이자 :&nbsp;</td><td><span style=\"text-wrap-mode: wrap;\">(</span><span style=\"text-wrap-mode: wrap; background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"text-wrap-mode: wrap;\">)원</span></td></tr><tr><td><br></td><td>정확한 청구금액은 거래인기준 상이하오니 문의 부탁드립니다([회사연락처])</td></tr></tbody></table><p><br></p><h4 style=\"text-align: center; \"><b>입금계좌 : 우리은행 1005-380-207056 (주)페이데이캐피탈대부 T.1666-6979</b></h4><p><br></p><p></p><div style=\"text-align: center;\"><font size=\"2\" style=\"color: rgb(255, 0, 0);\">※채권추심업무 처리절차와 채무자의 불법채권추심 대응요령은 \r\n당사홈페이지(</font><font size=\"2\" color=\"#0000ff\">https://pdloan.co.kr</font><font size=\"2\" style=\"color: rgb(255, 0, 0);\">)</font></div><font size=\"2\" style=\"color: rgb(255, 0, 0);\"><div style=\"text-align: center;\">하단에 공시되어 있으며 공시내용에 대하여 \r\n당사(02-1666-7640 담당자:이종록)로 전화문의도 가능합니다.</div></font><br><div style=\"text-align: center;\">※ 이미 입금하신 경우에는 이 독촉장을 파기하여 주십시오.</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><br></div><h2 style=\"text-align: center;\"><b>[회사명]</b>[법인인감]</h2><p></p>','2025-11-25 12:05:42','2025-11-25 12:05:42');
INSERT INTO `certificate_templates` VALUES ('5','legal_action_notice','법적절차 착수 최고 통보장','<h1 style=\"text-align: center; font-size: 24px;\"><u>법적절차 착수 최고 통보장</u></h1><p><strong><br></strong></p><p><strong>발신: [회사명]</strong></p><p><strong>주소: [회사주소]</strong></p><p><strong>수신:</strong>&nbsp;[고객명]</p><p><strong>주소:</strong>&nbsp;[고객주소]</p><p><br></p><p>&nbsp;귀하의 성의 있는 채무이행을 기대하며 원만한 해결을 위해 노력하였습니다만 귀하에게서 어떠한 채무 이행의 노력도 엿보이지 않아 대부거래 약관 \r\n제12조 3항 1호 규정에 의해 귀하에게 인정된 소정의 기한의 이익은 상실하게 되었음을 통보드립니다. 이후 귀하의 모든 재산에 대해 법적 절차가 \r\n아래와 같이 진행될 수 있으니 귀하께서는 조속히 처리하시어 귀하의 가계 및 사업상에 막대한 지장을 초래하는 일이 없도록 해결을 당부 \r\n드립니다.</p><p>&nbsp;&nbsp;&nbsp;귀하가 본 최고서를 받고도 7일 이내 까지 당초 제출하기로 약속한 대부계약서 제출이 없다면 본회사는 부득이 귀하를 상대로 \r\n아래와 같은 민,형사적 법적절차를 착수할 예정이며 이에 제반되는 이자 및 모든 법비용도 채무자인귀하의 부담이 되심을 각별히 유의 하시기 \r\n바랍니다.&nbsp;</p><p style=\"text-align: center; \"><br></p><p style=\"text-align: center; \">- 아&nbsp; &nbsp; 래 -</p><p style=\"text-align: center; \"><br></p><table class=\"table table-bordered\"><tbody><tr><td><p>1. 민사집행법</p><p>&nbsp; &nbsp; - 본인소유 부동산 발견시 가압류, 압류 경매</p><p>&nbsp; &nbsp; - 본인직장 급여채권 및 퇴직금채권 압류 및 추심, 전부명령신청</p><p>&nbsp; &nbsp; - 초본지 자택 유체동산 압류 및 경매</p><p>&nbsp; &nbsp; - 본인계좌(거래은행) 압류</p><p>&nbsp; &nbsp; - 재산명시 신청(법원미출석 또는 허위보고시 벌금 또는 구류)하여 은닉재산 파악</p><p>2. 형 법</p><p>&nbsp; &nbsp; - 사기죄(대출후 1~2회만 납부 후 장기연체하는등 기망행위가 있을 시)</p><p>&nbsp; &nbsp; - 사문서위조죄(대출당시 재직증명서 또는 급여명세서 등 위조한 경우)</p></td></tr></tbody></table><p style=\"text-align: center; \"><br><br></p><p style=\"text-align: center;\"><b>[오늘날짜]</b></p><p style=\"text-align: center;\"><font color=\"#ff0000\" style=\"font-size: small;\">※채권추심업무 처리절차와 채무자의 불법채권추심 대응요령은 당사홈페이지(</font><font color=\"#0000ff\" style=\"font-size: small;\"><a href=\"http://hpplus.co.kr/\">https://</a>pdloan.co.kr</font><font color=\"#ff0000\" style=\"font-size: small;\">)</font></p><div style=\"text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">하단에 공시되어 있으며 공시내용에 대하여 당사([회사연락처] 담당자:[담당자명])로 전화문의도 가능합니다.</span></div><p><font size=\"2\"></font></p><div style=\"text-align: center;\"><p style=\"font-size: 18px; font-weight: bold;\">[회사명]<strong style=\"font-size: 14px;\">[법인인감]</strong></p></div>','2025-11-25 12:05:42','2025-11-25 12:05:42');
INSERT INTO `certificate_templates` VALUES ('6','claim_assignment_notice','채권 양도 통지서','<h1 style=\"text-align: center; \"><u><b>채권 양도통지 안내문</b></u></h1><p><u>[고객명]&nbsp; 귀하</u></p><p><u><br></u></p><p>&nbsp;[고객명]님 귀하의 무궁한 발전을 기원합니다.</p><p>귀하와 [회사명] 사이에 체결된 금전소비대차계약(대부거래계약)에 있어 [회사명]이 귀하에 대하여 가지는 일체의 금전채권에 관한 권리를</p><p>(<span style=\"background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span>)에 양도 하였는바, 이에 도의 채권양도 사실을 통지합니다.</p><p><br></p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td><b>■ 양도인 -&nbsp;</b></td><td>[회사명]</td></tr><tr><td>주소</td><td>[회사주소]</td></tr><tr><td>연락처</td><td>[회사연락처]</td></tr><tr><td><b>■ 양수인 -&nbsp;</b></td><td><span style=\"background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></td></tr><tr><td>주소</td><td><span style=\"background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></td></tr><tr><td>연락처</td><td><span style=\"background-color: rgb(255, 255, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></td></tr></tbody></table><p><br></p><p>상기의 내용과 같이 채권양도에 따른 변동사항</p><p><br></p><table class=\"table table-bordered\"><tbody><tr><td><p>□ 귀하와 [회사명]사이에 체결된 대부거래약정서상의 제반 금융조건은 동일합니다.</p><p><br></p><p>- 채무자 (생년월일) :<b> [고객명] ([주민번호])</b> / 보증인 (생년월일) :<b> [보증인명] ([보증인주민번호])</b></p><p>- 대출잔액 :<b> [대출잔액]</b>&nbsp; /&nbsp; 약정일 :<b> [약정일]</b>&nbsp; / 대출이율 :<b> [정상금리]</b>&nbsp; /&nbsp; 연체이율 :<b> [연체금리]</b></p><p>- 대출계약일 :<b> [대출일]</b>&nbsp; /&nbsp; 대출만기일 : <b>[만기일]</b></p><p><br></p><p>□ 입금계좌는 양수인이 별도로 연락드리거나 가상계좌인 경우는 계좌는 동일하나 예금주가 변경될 수 있습니다</p><p><br></p><p>□ 채권양도에 따라 변경된 금전소비대차계약서를 교부할 수도 있으니 번거로우시더라도 동일한 계약조건을 기재하여 보내주시기바랍니다.</p></td></tr></tbody></table><p><br></p><p>&nbsp;위 사항과 관련하여 문의사항이 있으시면 채권양수인의 연락처로 문의 하시기 바랍니다. 감사합니다.</p><p><br></p><p style=\"text-align: center; \"><b>[오늘날짜]</b></p><h2 style=\"text-align: center; \"><b>[회사명]</b>[법인인감]</h2><p>발신 : [회사명]</p><p>&nbsp; &nbsp; &nbsp;[회사주소]</p><p><br></p><p>수신 : [고객명]</p><p>&nbsp; &nbsp; &nbsp;[고객주소]</p>','2025-11-25 12:05:42','2025-11-25 12:05:42');
INSERT INTO `certificate_templates` VALUES ('7','debt_repayment_cert','채무변제확인서','<p>\'채무변제확인서\' 템플릿의 기본 내용이 없습니다. 관리자 페이지에서 내용을 수정해주세요.</p>','2025-11-25 12:05:43','2025-11-25 12:05:43');
INSERT INTO `certificate_templates` VALUES ('8','transaction_history','거래내역서','<h1 style=\"text-align:center; font-size:24px;\">거 래 내 역 서</h1>\r\n<br>\r\n<p><strong>고객명:</strong> [고객명]</p>\r\n<p><strong>계약번호:</strong> [계약번호]</p>\r\n<p><strong>대출원금:</strong> [대출원금]</p>\r\n<p><strong>대출일:</strong> [대출일]</p>\r\n<p><strong>조회기간:</strong> [조회시작일] ~ [조회종료일]</p>\r\n<br>\r\n[거래내역테이블]\r\n<br><br>\r\n<p>위와 같이 거래내역을 확인합니다.</p>\r\n<br><br>\r\n<div style=\"text-align:center;\">\r\n    <p style=\"font-size:18px; font-weight:bold;\">[회사명][법인인감]</p>\r\n</div>\r\n','2025-11-25 12:05:43','2025-11-25 12:05:43');
INSERT INTO `certificate_templates` VALUES ('9','deposit_receipt','입금영수증','<p>\'입금영수증\' 템플릿의 기본 내용이 없습니다. 관리자 페이지에서 내용을 수정해주세요.</p>','2025-11-25 12:05:44','2025-11-25 12:05:44');
INSERT INTO `certificate_templates` VALUES ('10','repayment_schedule','상환예정 스케줄표','<h1 style=\"text-align: center; font-size: 24px;\">상 환 예 정 스 케 줄</h1><p><br></p><p style=\"text-align: center;\"><br></p><table class=\"table table-bordered\" style=\"width: 807px;\"><tbody><tr><td>계약번호</td><td>[계약번호] ([고객명])</td></tr><tr><td>대출일자</td><td>[대출일]</td></tr><tr><td>대출금액</td><td>[대출원금]</td></tr><tr><td>정상이자</td><td>[정상금리]</td></tr><tr><td>연체이자</td><td>[연체금리]</td></tr><tr><td><br></td><td></td></tr></tbody></table><p><span style=\"color: rgb(204, 204, 204); font-family: &quot;Segoe WPC&quot;, &quot;Segoe UI&quot;, sans-serif; font-size: 13px;\">&nbsp;</span><code style=\"font-family: &quot;Segoe WPC&quot;, &quot;Segoe UI&quot;, sans-serif; color: rgb(208, 208, 208); background-color: rgb(60, 60, 60); padding: 1px 3px; border-radius: 4px; overflow-wrap: break-word; font-size: 16px;\">[상환스케줄테이블]</code><span style=\"color: rgb(204, 204, 204); font-family: &quot;Segoe WPC&quot;, &quot;Segoe UI&quot;, sans-serif; font-size: 13px;\">&nbsp;</span></p>','2025-11-25 12:05:44','2025-11-25 12:05:44');
INSERT INTO `certificate_templates` VALUES ('11','debt_confirmation','채무확인서','<h1 style=\"text-align:center; font-size:24px;\">채 무 확 인 서</h1><br><br><p><strong>채무자 성명:</strong> [고객명]</p><p><strong>채무자 주소:</strong> [고객주소]</p><br><hr><br><p><strong>채권자</strong></p><p><strong>상호:</strong> [회사명]</p><p><strong>대표:</strong> [회사대표]</p><p><strong>주소:</strong> [회사주소]</p><p><strong>연락처:</strong> [회사연락처]</p><br><p>위 채무자는 [오늘날짜] 현재 당사에 대하여 아래와 같이 채무가 있음을 확인합니다.</p><p style=\"text-align:center;\"><strong><br></strong></p><p style=\"text-align:center;\"><strong>- 아 래 -</strong></p><table class=\"table table-bordered\"><tbody><tr><td>계약번호</td><td>[계약번호]</td></tr><tr><td>대출일자</td><td>[대출일]</td></tr><tr><td>대출금액</td><td>[대출원금]</td></tr><tr><td>대출잔액</td><td>[대출잔액]</td></tr><tr><td>이자금액</td><td>[오늘이자금액] / [오늘날짜] 기준</td></tr><tr><td>총금액</td><td>[완납금액] /<span style=\"background-color: rgb(254, 254, 254);\">&nbsp;[오늘날짜] 기준</span></td></tr></tbody></table><p style=\"text-align:center;\"><br></p><b><div style=\"text-align: right;\"><b>상환계좌 : 우리은행 1005-380-207056 (주)페이데이캐피탈대부 / <font color=\"#ff0000\">{입금시 채무자(고객명)필수}</font></b></div></b><br><p style=\"text-align:center;\">[오늘날짜]</p><br><div style=\"text-align:center;\"><p style=\"font-size:18px; font-weight:bold;\">[회사명]</p><p><strong>대표이사: [회사대표] [법인인감]</strong></p></div>','2025-11-25 12:05:45','2025-11-25 12:05:45');
