INSERT INTO `sms_templates` VALUES ('11','대출실행 후 안내 01','[페이데이][고객명]님 [대출일] [최초대출원금] 대출실행되었습니다. 보이스피싱에 항시 주의하세요 약정일 이자납부시 상환계좌는 [이자납부계좌] 입니다. 중개인등이 중개수수료를 요구하는것은 불법입니다.','2025-07-23 12:43:05');
INSERT INTO `sms_templates` VALUES ('12','대출완료 02','[(주)페이데이캐피탈대부][고객명]님 대출송금이 완료되어 대출관련 정보를 안내해드립니다. [고객명]님의 이자납부계좌는 [이자납부계좌]입니다. 안전한 금융거래 부탁드리며 주의사항 안내해드립니다. 페이데이캐피탈대부에서는 고객님의 이자납부계좌, 이자납부모계좌 외에는 어떠한 사유로도 절대 송금요청을 하지 않습니다. 최근 발신번호까지 조작하는 보이스피싱 및 금리인하등을 이유로 개인명의 계좌로 송금을 유도하는 사례가 발생되고있으니 이점 각별히 유의해주시기바랍니다. 보이스피싱 피해가 발생할 경우 금감원콜센터(국번없이1332)나 경찰청(국번없이 112) 한국인터넷진흥원시싱사이트신고(국번없이118)로 연락부탁드립니다. 피싱사기는 예방만이 최선의 방법 입니다. 조금이라도 의심스러운 부분이 있으시면 먼저 당사로 전화주셔서 반드시 확인후 송금해주시기 바랍니다.','2025-07-23 12:47:14');
INSERT INTO `sms_templates` VALUES ('13','대출완료 03','[대출 후 추가안내사항] *대부기간별·상환방법별 납입금액의 차이* 1.(원리금균등상환방식)은 매달 납입하는 금액이 같으며, 원금과 이자를 분할상환하기 때문에 납입금액을 높게 설정할수록 계약기간이 짧아 이자부담도 점차 줄어들게 됩니다. 2.(원금만기상환방식)은 매달 이자만 납입하기 때문에 월 납입에 대한 부담이 적지만, 원리금균등상환방식 보다 거래기간에 납부해야 하는 이자는 더 많으며 만기일에 원금을 일시 상환하여야 합니다. *대부이용자 주의사항 * 1. 신용등급 또는 개인신용평점 올려 준다며 전산 작업비, 공탁금, 보증료 등의 입금을 요구하거나 대환대출, 대출취소, 마이너스통장 개설 등을 빌미로 완납을 유도하는 대출사기에 주의하시기 바랍니다. ※ 앱(어플) 설치, 홈페이지 접속 등 출처가 확인되지 않은 문자는 절대 클릭하시면 안됩니다. 2. 통상 이자를 지급하여야 할 때부터 2개월 간 지체할 경우에 기한의 이익을 상실하게 되며 계약만료일 전에 채무를 전액 상환하여야 합니다. (대부거래표준약관 제12조를 참조) 3. 연체기간 5영업일 이상, 연체금액 10만원 이상의 연체가 발생하는 경우 신용정보회사에 해당정보가 공유되고, 3개월 이상 연체한 경우 한국신용정보원 등 종합신용정보집중기관에 연체정보가 등록되어 신용등급 또는 개인신용평점 하락에 따른 신용카드 사용정지와 금융거래 등에 불편이 발생할 수 있습니다 4. 대부이용자는 각종 소개비, 대부중개수수료 등은 지급할 의무가 없습니다. 5. 대출서류 위·변조, 타인의 정보 도용, 허위 작업대출, 통장 및 현금카드 불법 매매·양도 시 민·형사상 책임이 있으며 형사처벌의 대상이 됩니다. 6. 여러 대부업체 대출을 이용 할 경우 귀하의 신용등급 또는 개인신용평점이 하락할 수 있습니다.','2025-07-23 12:47:47');
